    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 NOT BETWEEN + 91 - - - col0 AND + col1 + - ( + col2 ) - + col2;
  - name: tab1

outputs:
  - name: q9467.out
    data: |
      51	14	96
      85	5	59
      91	47	68
